import {Component} from '@angular/core';

@Component({
  selector: 'app-root',
  templateUrl: './app.component.html',
  styleUrls: ['./app.component.scss']
})
export class AppComponent {
  savefile?: string = '';
  savedata: Record<string, string> = {};
  generalDataSource: any = [];
  displayedColumns: any = ['key', 'player1'];

  import() {
    this.savedata = JSON.parse(atob(this.savefile!));

    // Exclude this
    ['loaded', 'first', 'second', 'third', 'fourth', 'fifth', 'sixth', 'seventh', 'eighth'].forEach(x => {
      Object.keys(this.savedata).forEach(key => {
        if (key.startsWith(x)) delete this.savedata[key];
      });
    });
    console.log(`this.savedata`, this.savedata);

    this.generalDataSource = [
      {text: 'Version', key: 'version', player1: this.savedata['version']},
      {text: 'Singularity', key: 'singularityCount', player1: this.savedata['singularityCount']},
      {text: 'Cubes on hand', key: 'wowCubes', player1: this.savedata['wowCubes']},
      {text: 'Tesseracts on hand', key: 'wowTesseracts', player1: this.savedata['wowTesseracts']},
      {text: 'Hypercubes on hand', key: 'wowHypercubes', player1: this.savedata['wowHypercubes']},
      {text: 'Platonic cubes on hand', key: 'wowPlatonicCubes', player1: this.savedata['wowPlatonicCubes']},
      {text: 'Hepteracts on hand', key: 'wowAbyssals', player1: this.savedata['wowAbyssals']},
      {text: 'Golden quarks', key: 'goldenQuarks', player1: this.savedata['goldenQuarks']},
      {text: 'Overflux orbs', key: 'overfluxOrbs', player1: this.savedata['overfluxOrbs']},
      {text: 'Overflux powder', key: 'overfluxPowder', player1: this.savedata['overfluxPowder']},
      {text: 'RNG code', key: 'rngCode', player1: this.savedata['rngCode']},
    ];

    this.generalDataSource.forEach((item: any) => delete this.savedata[item.key]);

    delete this.savefile;
  }
}
